import React, { useState } from "react";
import "../assets/css/Rastreio.css";

function Rastreio() {
  const [docNumber, setDocNumber] = useState("");
  const [docPrefix, setDocPrefix] = useState("957");
  const [soType, setSoType] = useState("SO");
  const [rastreamentoDados, setRastreamentoDados] = useState(null);
  const [carregando, setCarregando] = useState(false);
  const [erro, setErro] = useState("");

  const gerarLinkRastreio = async () => {
    if (!docNumber) {
      alert("Por favor, insira o número do AWB.");
      return;
    }

    setCarregando(true);
    setErro("");
    setRastreamentoDados(null);

    try {
      const response = await fetch(
        `http://localhost:8000/api/rastreio/?docNumber=${docNumber}&docPrefix=${docPrefix}&soType=${soType}`
      );
      const data = await response.json();

      if (data.error) {
        setErro(data.error);
      } else {
        setRastreamentoDados(data);
      }
    } catch (error) {
      setErro("Erro ao buscar rastreamento. Verifique sua conexão.");
    } finally {
      setCarregando(false);
    }
  };

  const abrirNovaAba = () => {
    window.open(
      `https://www.latamcargo.com/pt/trackshipment?docNumber=${docNumber}&docPrefix=${docPrefix}&soType=${soType}`,
      "_blank"
    );
  };

  return (
    <div className="rastreio-container">
      <h2>Rastreio de Encomenda</h2>

      {/* Formulário de Rastreamento */}
      <div className="rastreio-form">
        <label>Tipo:</label>
        <select value={soType} onChange={(e) => setSoType(e.target.value)}>
          <option value="SO">Doméstico</option>
          <option value="MAWB">Internacional</option>
        </select>

        <label>Prefixo:</label>
        <input
          type="text"
          name="prefixo"
          value={docPrefix}
          maxLength="3"
          onChange={(e) => setDocPrefix(e.target.value)}
        />

        <label>Número do AWB:</label>
        <input
          type="text"
          name="awb"
          value={docNumber}
          onChange={(e) => setDocNumber(e.target.value)}
          placeholder="Digite o AWB"
        />
      </div>

      {/* Botões */}
      <div className="rastreio-buttons">
        <button onClick={gerarLinkRastreio}>Rastrear</button>
        <button onClick={abrirNovaAba}>Abrir em Outra Aba</button>
      </div>

      {/* Carregamento */}
      {carregando && <p>Buscando informações...</p>}

      {/* Erro */}
      {erro && <p className="erro">{erro}</p>}

      {/* Resultado do Rastreamento */}
      {rastreamentoDados && (
        <div className="resultado-container">
          <h2>Resultado do Rastreamento</h2>
          <p>
            <strong>Status:</strong> {rastreamentoDados.status}
          </p>
          <p>
            <strong>Origem:</strong> {rastreamentoDados.origem}
          </p>
          <p>
            <strong>Destino:</strong> {rastreamentoDados.destino}
          </p>
          <p>
            <strong>Última Atualização:</strong>{" "}
            {rastreamentoDados.ultima_atualizacao}
          </p>

          <h3>Eventos</h3>
          <ul>
            {rastreamentoDados.eventos.map((evento, index) => (
              <li key={index}>
                {evento.data} - {evento.local}: {evento.descricao}
              </li>
            ))}
          </ul>

          {/* Informações adicionais conforme LATAM Cargo */}
          <div className="info-adicional">
            <h3>Informações Adicionais</h3>
            <p>
              Se sua remessa não for exibida, entre em contato com o{" "}
              <a href="https://www.latamcargo.com/en/customercare">
                atendimento ao cliente
              </a>
              .
            </p>
            <p>
              Para envios internacionais, você pode programar mensagens de
              atualização de status. Entre em contato com{" "}
              <a href="mailto:grp_digitalcontinuity@latam.com">
                grp_digitalcontinuity@latam.com
              </a>
              .
            </p>
          </div>
        </div>
      )}
    </div>
  );
}

export default Rastreio;
